import React from 'react';
import './css/coursepage.css'
import Footer from './Footer'

const Courses = () => {
 return (
  <div className='courses'>
      <div className="backgroundcourses">
        <div className="text">
          <h1 className="textone">SCOPE INDIA</h1>
          <h2 className="textheading">Center for Software, Networking, & Cloud Education</h2>
          <p className="textdescription">
            All Trainers at SCOPE INDIA are working professionals, Software Engineers, Networking Engineers, and Software Test Engineers of Suffix E Solutions with
            <span className="textbold"> 17 years of Industrial experience.</span>
          </p>
           <div className='stars' >
             </div>
            <div className="google">Google 4.9 * Rated Institute</div>
         
        </div>
      </div>
      <div>
            <Footer/>
          </div>
          </div>


  );
};

export default Courses;
